import DefaultPicture from '../../Assets/images.jpeg'
import Card from '../../components/Card'
import styled from 'styled-components'
import { useEffect, useState } from 'react'

const CardContainer = styled.div`
    display: grid;
    margin-left: 40px;
    gap: 40px;
    grid-template-rows: 350px 350px;
    grid-template-columns: repeat(2, 1fr);
`

const StyledTitle = styled.h3`
    text-align: center;`

const freelanceProfiles = [
    {
        name: 'Jane Doe',
        jobTitle: 'Devops',
        picture: DefaultPicture,
    },
    {
        name: 'John Doe',
        jobTitle: 'Developpeur frontend',
        picture: DefaultPicture,
    },
    {
        name: 'Jeanne Biche',
        jobTitle: 'Développeuse Fullstack',
        picture: DefaultPicture,
    },
]

function Freelances() {
    const [FreelancesData, setSurveyData] = useState({})
    const [isDataLoading, setDataLoading] = useState(false)
    const [error, setError] = useState(null)

    useEffect(() => {
        async function fetchSurvey() {
            setDataLoading(true)
            try {
                const response = await fetch(`http://localhost:8000/survey`)
                const { surveyData } = await response.json()
                setSurveyData(surveyData)
            }
            catch(err) {
                console.log(err)
                setError(true)
            } finally {
                setDataLoading(false)
            }
        }
        fetchSurvey()
    }, [])
    return (
        <div>
            <h2 style={{'textAlign': 'center'}}>Trouvez votre prestataire</h2>
            <StyledTitle>Chez Shiny nous réunissons les meilleurs profils pour vous</StyledTitle>
            <CardContainer>
                {freelanceProfiles.map((profile, index) => (
                    <Card
                        key={`${surveyData.name}-${index}`}
                        label={profile.jobTitle}
                        picture={profile.picture}
                        title={profile.name}
                    />
                ))}
            </CardContainer>
        </div>
    )
}

export default Freelances
